Giro d'Italia 2013 Review

Travel Documentary hosted by Rob Hatch, published by Eurosport in 2014 - English narration


Information
------------------------------

A review of the 2013 Giro d'Italia. Vincenzo Nibali produced a dominant display over three weeks to wrap up his first victory in the race.

